import React from 'react';
import { motion } from 'framer-motion';
import './App.css';

function App() {
  return (
    <div className="App">
      {/* Header/Navigation */}
      <motion.header 
        className="header"
        initial={{ opacity: 0, y: -50 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
      >
        <div className="nav-container">
          <motion.div 
            className="logo"
            whileHover={{ scale: 1.05 }}
          >
            Code-XR
          </motion.div>
          <nav className="nav-menu">
            <motion.a href="#inicio" whileHover={{ scale: 1.1 }}>Inicio</motion.a>
            <motion.a href="#servicios" whileHover={{ scale: 1.1 }}>Servicios</motion.a>
            <motion.a href="#sobre-nosotros" whileHover={{ scale: 1.1 }}>Sobre Nosotros</motion.a>
            <motion.a href="#contacto" whileHover={{ scale: 1.1 }}>Contacto</motion.a>
          </nav>
        </div>
      </motion.header>

      {/* Hero Section */}
      <motion.section 
        className="hero"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
      >
        <motion.div 
          className="hero-content"
          initial={{ y: 100, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ duration: 1, delay: 0.3 }}
        >
          <motion.h1 
            className="hero-title"
            initial={{ scale: 0.8 }}
            animate={{ scale: 1 }}
            transition={{ duration: 0.8, delay: 0.5 }}
          >
            Bienvenido a <span className="brand">Code-XR</span>
          </motion.h1>
          <motion.p 
            className="hero-subtitle"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.8, delay: 0.7 }}
          >
            Desarrollamos experiencias de Realidad Extendida que transforman tu negocio
          </motion.p>
          <motion.button 
            className="cta-button"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.9 }}
            whileHover={{ scale: 1.05, boxShadow: "0px 10px 20px rgba(0,0,0,0.2)" }}
            whileTap={{ scale: 0.95 }}
          >
            Descubre Nuestros Servicios
          </motion.button>
        </motion.div>
      </motion.section>

      {/* Services Section */}
      <motion.section 
        className="services"
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <motion.h2 
          className="section-title"
          initial={{ y: 50, opacity: 0 }}
          whileInView={{ y: 0, opacity: 1 }}
          transition={{ duration: 0.6 }}
        >
          Nuestros Servicios
        </motion.h2>
        <div className="services-grid">
          {[
            { title: "Realidad Virtual", desc: "Experiencias inmersivas que transportan a tus usuarios", icon: "ü•Ω" },
            { title: "Realidad Aumentada", desc: "Superpone elementos digitales al mundo real", icon: "üì±" },
            { title: "Desarrollo Web XR", desc: "Aplicaciones web con tecnolog√≠as WebXR", icon: "üåê" }
          ].map((service, index) => (
            <motion.div 
              key={index}
              className="service-card"
              initial={{ opacity: 0, y: 50 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.2 }}
              whileHover={{ scale: 1.05, rotateY: 5 }}
            >
              <div className="service-icon">{service.icon}</div>
              <h3>{service.title}</h3>
              <p>{service.desc}</p>
            </motion.div>
          ))}
        </div>
      </motion.section>

      {/* About Section */}
      <motion.section 
        className="about"
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <motion.h2 
          className="section-title"
          initial={{ y: 50, opacity: 0 }}
          whileInView={{ y: 0, opacity: 1 }}
          transition={{ duration: 0.6 }}
        >
          Sobre Code-XR
        </motion.h2>
        <motion.p 
          className="about-text"
          initial={{ y: 30, opacity: 0 }}
          whileInView={{ y: 0, opacity: 1 }}
          transition={{ duration: 0.6, delay: 0.2 }}
        >
          Somos una empresa especializada en el desarrollo de aplicaciones de Realidad Extendida (XR), 
          combinando Realidad Virtual, Realidad Aumentada y tecnolog√≠as web modernas para crear 
          experiencias √∫nicas e innovadoras.
        </motion.p>
      </motion.section>

      {/* Footer */}
      <motion.footer 
        className="footer"
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
      >
        <p>&copy; 2025 Code-XR. Todos los derechos reservados.</p>
      </motion.footer>
    </div>
  );
}

export default App;
